func HasCustomDomainsWith(preds ...predicate.CustomDomain) predicate.MappableDomain {
	return predicate.MappableDomain(func(s *sql.Selector) {
		step := newCustomDomainsStep()
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.CustomDomain
		step.Edge.Schema = schemaConfig.CustomDomain
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.MappableDomain) predicate.MappableDomain {
	return predicate.MappableDomain(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.MappableDomain) predicate.MappableDomain {
	return predicate.MappableDomain(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.MappableDomain) predicate.MappableDomain {
	return predicate.MappableDomain(sql.NotPredicates(p))
}
